import React, { Component } from "react";

class UploadManual1 extends Component {
  state = {
    input: "",
  };
  render() {
    return (
      <div>
        <form autocomplete="on">
          <input type="text" />
        </form>
      </div>
    );
  }
}

export default UploadManual1;
